var getItem = function (key) {
    return msg.payload.find(function (v) {
        return v.part_name === key;
    });
};

var getX = function (key) {
    var item = getItem(key);
    if (item && item.x) {
        return item.x
    } else {
        return undefined;
    }
};

var getY = function (key) {
    var item = getItem(key);
    if (item && item.y) {
        return item.y
    } else {
        return undefined;
    }
};

if (msg.payload && getItem('RElbow') && getItem('RShoulder') && getItem('LShoulder')) {
    msg.payload = (Math.atan2(getY('RElbow')-getY('RShoulder'),
                              getX('RElbow')-getX('RShoulder'))
                 - Math.atan2(getY('LShoulder')-getY('RShoulder'),
                              getX('LShoulder')-getX('RShoulder')))
                 * 180 / Math.PI;

    if (-180 < msg.payload && msg.payload < -120) {
        return [null, msg];
    } else {
        return [msg, null];
    }
}
